result:
.acquisition-container{
  color: #1D2133;

  .bg{
    background-color: #ffffff;
    border-radius: 6px;
    padding: 30px;
    height: 100%;
  }

  p{
    margin: 0;
  }

  .title{
    font-size: 16px;
    font-weight: 550;
  }

  .p-btn{
    text-decoration: underline;
    color: rgb(63, 106, 255);
    cursor: pointer;
    margin-left: 20px;
    display: inline-block;
  }

  .f-l{
    float: left;
  }

  .f-r{
    float: right;
  }

  .first-row{
    height: 100%;

    .company{
      height: 240px;
    }

    .company-tree{
      height: calc(100% - 20px);
      margin-top: 40px;
      overflow-y: auto;
    }

    .platform{
      margin-top: 15px;
      height: calc(100% - 255px);
    }

    .collection{
      width: 350px;
    }
  }
}
